# LinkedList in std::collections::linked\_list - Rust

```
pub struct LinkedList<T, A = Global>where
    A: Allocator,{ /* private fields */ }
```

Expand description

A doubly-linked list with owned nodes.

The `LinkedList` allows pushing and popping elements at either end in constant time.

A `LinkedList` with a known list of items can be initialized from an array:

```
use std::collections::LinkedList;

let list = LinkedList::from([1, 2, 3]);
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++use+std::collections::LinkedList;%0A++++%0A++++let+list+=+LinkedList::from(%5B1,+2,+3%5D);%0A%7D&edition=2021)

NOTE: It is almost always better to use [`Vec`](../../vec/struct.Vec.html "struct std::vec::Vec") or [`VecDeque`](../struct.VecDeque.html "struct std::collections::VecDeque") because array-based containers are generally faster, more memory efficient, and make better use of CPU cache.

